import React from "react";
import { NavLink } from "react-router-dom";
import axios from "axios";

import Navbar from "../Navbar";
import AuthenticationService from "../AuthenticationService";

const API_URL = "http://localhost:8080";

function executeGetUserAccount() {
  return axios.post(`${API_URL}/account/getUserProfile`, {});
}

// getUserProfile(@AuthenticationPrincipal UserDetails auditorUser,  int user_id) 
// - Returns account information of the specified_user at specified access_level DONE

function Account({ filterChecklistTypes }) {
  executeGetUserAccount()
    .then((response) => {
      console.log(response.data);
    })
  const name = AuthenticationService.getLoggedInUserName();
  const id = "";
  const user_type = "";
  return (
    <div>
      <Navbar />
      <h2>Account</h2>
      <div>Name: {name}</div>
      <div>User ID: {id}</div>
      <div>User Type: {user_type}</div>
    </div>
  );
}

export default Account;
